// import logo from './logo.svg';
import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default class App extends Component {

  render() {
    return (
      <div>
        <Router>
          <Navbar/>

          <Switch>
            <Route path="/about"><News pageSize={6} country="in" category="general"/><about /></Route>
            <Route path="/business"><News pageSize={6} country="in" category="business"/><business /></Route>
            <Route path="/entertainment"><News pageSize={6} country="in" category="entertanment"/><entertainment /></Route>inment
            <Route path="/general"><News pageSize={6} country="in" category="general"/><general /></Route>
            <Route path="/health"><News pageSize={6} country="in" category="health"/><health /></Route>
            <Route path="/science"><News pageSize={6} country="in" category="science"/><science /></Route>
            <Route path="/sports"><News pageSize={6} country="in" category="sports"/><sports /></Route>
            <Route path="/technology"><News pageSize={6} country="in" category="technology"/><technology /></Route>

        </Switch>
        </Router>
      </div>
    )
  }
}
